import React, {Component} from 'react';

class countryList extends Component{
	render(){
		return(
			<div style={{overflow: 'auto', height: 'inherit', display: 'block', maxWidth: 300, marginLeft: 20,}}>
                <li> Item visible</li>
                <li> Item visible</li>
                <li> Item visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
            </div>
		);
	}
}
export default countryList;
